  REGI01_box5EN,
  REGI01_box5DE,
  REGI01_box5TH,
  // RegisterTranslator
  REGI02_Box1v02EN,
  REGI02_Box1v02DE,
  REGI02_Box1v02TH,
  REGI02_Box2v02EN,
  REGI02_Box2v02DE,
  REGI02_Box2v02TH,
  REGI02_Box4v01EN,
  REGI02_Box4v01DE,
  REGI02_Box4v01TH,
  REGI02_Box3v02EN,
