                    <button
                      style={{
                        fontWeight: 400,
                        fontSize: 18,
                        textDecorationLine: "none",
                        textAlign: "left",
                        marginBottom: 20,
                        float: "left",
                        background: "transparent",
                        border: "none",
                      }}
                      onClick={() => goHome(Doc)}
                    >
                      <p id={"Hometext"}>{REGI01_box1EN[0].label}</p>
                      <BsArrowLeftShort id={"Hometext2"} />
                    </button>

                    <button
                      style={{
                        fontWeight: 400,
                        textAlign: "right",
                        marginBottom: 20,
                        float: "right",
                        color: "#D9D9D9",
                        background: "transparent",
                        border: "none",
                      }}
                      onClick={() => goLogin(Doc)}
                    >
                      <p id={"Signuptext"}>{REGI01_box1EN[1].label}</p>
                      <BsArrowRightShort id={"Signuptext2"} />
